import React from 'react';
import {NavLink} from 'react-router-dom';
const Menu = () =>{
    return(
        <>
        <NavLink style={{textDecoration:'none'}} exact activeClassName="active_class" to='/'>About us</NavLink>
        <NavLink style={{textDecoration:'none'}} exact activeClassName="active_class" to='/contact'>Contact us</NavLink>
        <br/>
          <a href="/">About</a>
          <a href="/contact">Contact</a>
        </>
    )
}

export default Menu;
